// CHANGE: Common utilities for ESLint integration tests
// WHY: Eliminate code duplication between test files
// PURITY: SHELL (test utilities)

import type { TSESLint } from "@typescript-eslint/utils";
import { Effect } from "effect";
import type { Linter } from "eslint";
import { ESLint } from "eslint";
import * as fs from "fs";
import { join } from "path";
import { expect } from "vitest";
import type plugin from "../../src/index.js";
import { TEST_CONFIG } from "../setup.js";

type ParserModule = TSESLint.Parser.ParserModule & {
	readonly default?: TSESLint.Parser.ParserModule;
};

const toLegacyPlugin = (loaded: typeof plugin): Linter.Plugin =>
	loaded as unknown as Linter.Plugin;

const loadTypeScriptParser = (): Effect.Effect<
	TSESLint.Parser.ParserModule,
	Error
> =>
	Effect.tryPromise({
		try: () =>
			import("@typescript-eslint/parser").then((module) => {
				const tsParserModule: ParserModule = module;
				return tsParserModule.default ?? tsParserModule;
			}),
		catch: (error) =>
			error instanceof Error ? error : new Error(String(error)),
	});

/**
 * Configuration for ESLint test setup
 */
export interface ESLintTestConfig {
	readonly tempDirName: string;
	readonly useTypeScript?: boolean;
	readonly cwd?: string;
}

/**
 * Test file manager for temporary files
 */
export class TestFileManager {
	private tempFiles: string[] = [];
	private readonly tempDir: string;

	constructor(tempDirName: string, cwd: string = process.cwd()) {
		this.tempDir = join(cwd, tempDirName);
	}

	/**
	 * Setup temporary directory
	 */
	setup(): void {
		try {
			fs.mkdirSync(this.tempDir, { recursive: true });
		} catch {
			// Directory might already exist
		}
	}

	/**
	 * Create temporary file with content
	 */
	createFile(filename: string, content: string): string {
		const filePath = join(this.tempDir, filename);
		fs.writeFileSync(filePath, content, "utf8");
		this.tempFiles.push(filePath);
		return filePath;
	}

	/**
	 * Create temporary file in cwd (not in temp directory)
	 */
	createFileInCwd(filename: string, content: string): string {
		const filePath = join(process.cwd(), filename);
		fs.writeFileSync(filePath, content, "utf8");
		this.tempFiles.push(filePath);
		return filePath;
	}

	/**
	 * Cleanup all temporary files and directories
	 */
	cleanup(): void {
		this.tempFiles.forEach((file) => {
			try {
				fs.unlinkSync(file);
			} catch {
				// File might not exist
			}
		});
		try {
			fs.rmSync(this.tempDir, { recursive: true, force: true });
		} catch {
			// Directory might not exist
		}
		this.tempFiles = [];
	}
}

export interface TypeAwareESLintOptions {
	readonly rules: Linter.RulesRecord;
	readonly cwd?: string;
}

/**
 * Create file manager scoped to test-project source directory
 */
export const createTestProjectFileManager = (
	tempDirName: string,
): TestFileManager =>
	new TestFileManager(tempDirName, TEST_CONFIG.TEST_PROJECT_SRC_DIR);

/**
 * Create ESLint instance configured with TypeScript project awareness and provided rules
 */
export const createTypeAwareESLint = (
	options: TypeAwareESLintOptions,
): Effect.Effect<ESLint, Error> =>
	Effect.gen(function* (_) {
		const pluginModule = yield* _(
			Effect.tryPromise({
				try: () => import("../../src/index.js"),
				catch: (error) =>
					error instanceof Error ? error : new Error(String(error)),
			}),
		);
		const loadedPlugin: typeof plugin = pluginModule.default;
		const parser = yield* _(loadTypeScriptParser());

		return new ESLint({
			overrideConfigFile: true,
			overrideConfig: [
				{
					files: ["**/*.ts"],
					languageOptions: {
						parser,
						parserOptions: {
							...TEST_CONFIG.PARSER_OPTIONS,
							project: TEST_CONFIG.TSCONFIG_PATH,
							tsconfigRootDir: TEST_CONFIG.PARSER_OPTIONS.tsconfigRootDir,
						},
					},
					plugins: {
						"@ton-ai-core/suggest-members": toLegacyPlugin(loadedPlugin),
					},
					rules: options.rules,
				},
			],
			cwd: options.cwd ?? TEST_CONFIG.PARSER_OPTIONS.tsconfigRootDir,
		});
	});

/**
 * Lint single file with provided ESLint instance and return collected messages
 */
export const lintFileWithESLint = (
	eslint: ESLint,
	filePath: string,
): Effect.Effect<readonly Linter.LintMessage[], Error> =>
	Effect.tryPromise({
		try: () => eslint.lintFiles([filePath]),
		catch: (error) =>
			error instanceof Error ? error : new Error(String(error)),
	}).pipe(Effect.map((results) => results[0]?.messages ?? []));

/**
 * Expect exactly one lint message and apply assertion callback
 */
export function expectSingleLintMessage(
	messages: readonly Linter.LintMessage[],
	assertMessage: (message: Linter.LintMessage) => void,
): void {
	expect(messages).toHaveLength(1);
	const [message] = messages;
	if (message === undefined) {
		throw new Error("Expected a single lint message but found none");
	}
	assertMessage(message);
}

export interface LintWithRulesOptions {
	readonly rules: Linter.RulesRecord;
	readonly filePath: string;
	readonly assertMessage: (message: Linter.LintMessage) => void;
}

/**
 * Convenience helper: create ESLint with rules, lint file, and assert single message
 */
export const lintWithTypeAwareRules = (
	options: LintWithRulesOptions,
): Effect.Effect<void, Error> =>
	createTypeAwareESLint({ rules: options.rules }).pipe(
		Effect.flatMap((eslint) => lintFileWithESLint(eslint, options.filePath)),
		Effect.tap((messages) => {
			expectSingleLintMessage(messages, options.assertMessage);
		}),
		Effect.asVoid,
	);

/**
 * Create ESLint instance with suggest-exports rule
 */
export const createESLintWithSuggestExports = (
	config: ESLintTestConfig,
): Effect.Effect<ESLint, Error> =>
	Effect.gen(function* (_) {
		const pluginModule = yield* _(
			Effect.tryPromise({
				try: () => import("../../src/index.js"),
				catch: (error) =>
					error instanceof Error ? error : new Error(String(error)),
			}),
		);
		const loadedPlugin: typeof plugin = pluginModule.default;
		const pluginForESLint = toLegacyPlugin(loadedPlugin);

		const baseConfig: Linter.Config = {
			files: ["**/*.js", "**/*.ts", "**/*.tsx"],
			languageOptions: {
				ecmaVersion: 2020,
				sourceType: "module" as const,
			},
			plugins: {
				"@ton-ai-core/suggest-members":
					pluginForESLint as unknown as Linter.Plugin,
			},
			rules: {
				"@ton-ai-core/suggest-members/suggest-exports": "error",
			},
		};

		if (config.useTypeScript === true) {
			const parser = yield* _(loadTypeScriptParser());

			baseConfig.languageOptions = {
				...baseConfig.languageOptions,
				parser,
				parserOptions: {
					ecmaVersion: 2020,
					sourceType: "module",
					projectService: true,
				},
			};
		}

		return new ESLint({
			overrideConfigFile: true,
			overrideConfig: [baseConfig],
			cwd: config.cwd ?? process.cwd(),
		});
	});

