/**
 * Common test result analysis
 */
export interface TestResultAnalysis {
	readonly allMessages: readonly Linter.LintMessage[];
	readonly suggestExportsErrors: readonly Linter.LintMessage[];
	readonly errorMessages: string[];
}

/**
 * Analyze ESLint results for suggest-exports errors
 */
export function analyzeResults(
	results: readonly ESLint.LintResult[],
): TestResultAnalysis {
	const allMessages: readonly Linter.LintMessage[] = results[0]?.messages ?? [];
	const suggestExportsErrors = allMessages.filter(
		(msg) => msg.ruleId === "@ton-ai-core/suggest-members/suggest-exports",
	);
	const errorMessages = suggestExportsErrors.map((err) => err.message);

	return {
		allMessages,
		suggestExportsErrors,
		errorMessages,
	};
}

/**
 * Log test results for debugging
 */
export function logTestResults(
	testName: string,
	analysis: TestResultAnalysis,
): void {
	console.log(
		`${testName} - All messages:`,
		analysis.allMessages.map((m) => ({
			ruleId: m.ruleId,
			message: m.message,
			line: m.line,
			column: m.column,
		})),
	);
	console.log("Suggest exports errors:", analysis.suggestExportsErrors);
}

